                                <p class="card-text">El rebobinado de motores en ALCOINSAC es un proceso de precisión
                                    que
                                    inicia con la evaluación del núcleo magnético y retiro del bobinado dañado. <br>
                                    <br> Nuestro protocolo incluye cálculo preciso del nuevo bobinado según
                                    especificaciones
                                    originales, prueba del núcleo magnético para detectar cortocircuitos, y rebobinado
                                    manual especializado con alambre doble esmalte de calidad clase H. <br><br>

                                    Aplicamos doble barnizado aislante clase H con impregnación al vacío, seguido de
                                    tratamiento térmico en horno controlado entre 120-160°C para lograr la perfecta
                                    polimerización del barniz. El proceso culmina con pruebas de rigidez dieléctrica,
                                    medición de resistencia de aislamiento según IEEE 43-2000 y análisis de aceptación
                                    final antes de la entrega.
